//State machine

scene.state = null;
scene.states = {};
scene.createState = ({
  name,
  update = (e) => {},
  pointermove = (e) => {},
  pointerdown = (e) => {},
  pointerup = (e) => {},
  keydown = (e) => {},
  keyup = (e) => {},
  onchange = (e) => {},
  onstart = (e) => {},
  pointerdownVR = (e) => {},
  pointerupVR = (e) => {},
  updateVR = (e) => {},
}) => {
  if (name) {
    this.states[name] = {
      update,
      pointermove,
      pointerdown,
      pointerup,
      keydown,
      keyup,
      onstart,
      onchange,
      pointerdownVR,
      pointerupVR,
      updateVR,
    };
  } else {
    console.error("You must put a name to the State");
  }
};

scene.changeState = (state) => {
  if (state && this.states[this.state]) {
    if (this.states[this.state].onchange) {
      this.states[this.state].onchange();
    }
  }

  if (this.states[state].onstart) {
    this.states[state].onstart();
    if (this.states[state] && game.vr.currentSession) {
      this.states[state].pointerdown("SYNTHETIC");
    }
  }

  this.state = state;
};

scene.createState({
  name: "init",
});

scene.changeState("init");

//Animation
scene.animationMixers = {};

scene.traverse((item) => {
  if (item.animations.length > 0) {
    scene.animationMixers[item.name] = {
      mixer: new THREE.AnimationMixer(item),
      animations: item.animations,
    };
  }
});

scene.getAnimation = function (ObjectName, ClipName) {
  let match = null;

  for (
    let i = 0;
    i < scene.animationMixers[ObjectName].animations.length;
    i++
  ) {
    const currentClip = scene.animationMixers[ObjectName].animations[i];

    if (ClipName === currentClip.name) {
      match = currentClip;
    }
  }

  if (match) {
    return scene.animationMixers[ObjectName].mixer.clipAction(match);
  } else {
    console.error("This animation clip doesn't exist: " + ClipName);
  }
};

function getAllAnimations(rig, looping = THREE.LoopOnce) {
  const Rig = scene.getObjectByName(rig);
  const animations = {};
  scene.animationMixers[rig].animations = Rig.animations;

  for (let i = 0; i < Rig.animations.length; i++) {
    const animation = Rig.animations[i];
    const clip = scene.getAnimation(rig, animation.name);

    clip.setLoop(looping);
    clip.clampWhenFinished = true;

    animations[animation.name] = clip;
  }

  return animations;
}

scene.getAllAnimations = getAllAnimations;

function update(e) {
  const { delta } = e;

  for (let mixerName in scene.animationMixers) {
    const mixer = scene.animationMixers[mixerName].mixer;
    mixer.update(delta / 1000);
  }

  if (game.mouse) {
    if (game.phonevr.session) {
      game.mouse.x = 0;
      game.mouse.y = 0;
    }
  }

  scene.states[scene.state].update(e);
  if (game.vr.currentSession) {
    scene.states[scene.state].updateVR(e);
  }
}

function pointermove(e) {
  const { offsetX, offsetY } = e;

  if (game.mouse) {
    if (game.phonevr.session) {
      game.mouse.x = 0;
      game.mouse.y = 0;
    } else {
      game.mouse.x = (offsetX / player.width) * 2 - 1;
      game.mouse.y = -(offsetY / player.height) * 2 + 1;
    }
  }
  scene.states[scene.state].pointermove(e);
}

function pointerdown(e) {
  const { offsetX, offsetY } = e;

  if (game.mouse) {
    if (game.phonevr.session) {
      game.mouse.x = 0;
      game.mouse.y = 0;
    } else {
      game.mouse.x = (offsetX / player.width) * 2 - 1;
      game.mouse.y = -(offsetY / player.height) * 2 + 1;
    }
  }
  scene.states[scene.state].pointerdown(e);
}

function pointerup(e) {
  scene.states[scene.state].pointerup(e);
}

function keydown(e) {
  scene.states[scene.state].keydown(e);
}

function keyup(e) {
  scene.states[scene.state].keyup(e);
}

camera.position.set(0, 1.96, 2000);
camera.rotation.set(0, 0, 0);
camera.fov = 0.22;
camera.near = 1500;
camera.far = 2015;

camera.updateProjectionMatrix();

console.log(camera);

const RotacionIsometrica = new THREE.Group();

RotacionIsometrica.rotation.x = THREE.MathUtils.degToRad(-30);
RotacionIsometrica.rotation.y = THREE.MathUtils.degToRad(-45);
RotacionIsometrica.rotation.z = THREE.MathUtils.degToRad(0);

RotacionIsometrica.rotation.order = "ZYX";
RotacionIsometrica.name = "RotacionIsometrica";

const RotacionVertical = new THREE.Group();

RotacionVertical.name = "RotacionVertical";

scene.add(RotacionVertical);
RotacionVertical.add(RotacionIsometrica);
RotacionIsometrica.add(camera);

renderer.setClearColor(0x000000, 0); // the default

const RotacionVertical = scene.getObjectByName("RotacionVertical");

console.log("RotacionVertical", RotacionVertical);

//const GameCamera = scene.getObjectByName("GameCamera");
let speed = 0;
const maxSpeed = 0.2;
const force = 0.002;
const sensibility = 0.005;

const HitBox = scene.getObjectByName("HitBox");
HitBox.visible = false;

let rotatingByItself = true;
let rotationCounter = 0;
let mouseClickXCoord = 0;
let mouseClick = false;
let rotationOffset = 0;
const screenSize = { width: player.width, height: player.height };

//player.setCamera(GameCamera);

handleResize();

function update({ time, delta }) {
  if (rotatingByItself) {
    rotationCounter += (delta / 1000) * speed;
  }

  speed += force;
  speed = Math.min(speed, maxSpeed);

  RotacionVertical.rotation.y = rotationCounter;

  handleResize();
}

function pointerdown(e) {
  const { screenX, screenY } = e;

  const clickOnHitBox = game.raycast([scene.getObjectByName("HitBox")])[0];

  const boundingBox = player.dom.getBoundingClientRect();
  if (clickOnHitBox) {
    mouseClickXCoord = screenX;
    rotatingByItself = false;
    mouseClick = true;
    rotationOffset = rotationCounter;
    speed = 0;
    console.log("");
  } else {
    console.log("");
  }
}

function pointermove({ screenX }) {
  if (mouseClick) {
    rotationCounter =
      rotationOffset + (mouseClickXCoord - screenX) * sensibility;
  }
}

function pointerup(e) {
  rotatingByItself = true;
  mouseClick = false;
}

function handleResize() {
  if (player.width != screenSize.width || player.height != screenSize.height) {
    if (player.width < player.height * 0.8) {
      camera.fov = 0.4;
      camera.updateProjectionMatrix();
    } else {
      camera.fov = 0.22;
      camera.updateProjectionMatrix();
    }

    screenSize.width = player.width;
    screenSize.height = player.height;
  }
}

//Horse

sga["RigHorse"]["idle_eating"].play();

scene.animationMixers["RigHorse"].mixer.addEventListener(
  "finished",
  ({ action }) => {
    const animationName = action._clip.name;

    if (animationName == "idle_eating") {
      sga["RigHorse"]["idle_eating"].stop();
      sga["RigHorse"]["walk"].play();
    }

    if (animationName == "walk") {
      sga["RigHorse"]["walk"].stop();
      sga["RigHorse"]["idle_eating"].play();
    }
  }
);
